import React from "react";
import EditEmploye from "./EditEmploye";

function Employes({ name, role, img }) {
  return (
    <div className="">
      <div class="px-4 max-w-sm bg-white rounded-xl shadow-lg space-y-2 sm:flex sm:items-center sm:space-y-0 sm:space-x-6">
        <img
          class=" object-cover h-[100px] w-[100px] block mx-auto rounded-full sm:mx-0 sm:shrink-0"
          src={img}
          alt="Woman's Face"
        />

        <div class="text-center space-y-2 sm:text-left">
          <div class="space-y-0.5">
            <p class="text-lg text-black font-semibold">{name}</p>
            <p class="text-slate-500 font-medium">{role}</p>
          </div>

          <div className="flex gap-2">
            <EditEmploye />
          </div>
        </div>
      </div>
    </div>
  );
}

export default Employes;
